ISLAMABAD, Dec 11 (APP): The Senate of Pakistan on Wednesday offered Fateha for security personnel martyred in operations and terrorist incidents, besides Ali Hassan Gilani, Ilyas Bilour, and others.
Maulana Attaur Rehman, a leader of Jamiat Ulema-e-Islam-Fazl (JUI-F), led the Fateha at the request of Chairman Yusuf Raza Gilani.
